import { useState } from "react";
import BlogList from "./BlogList";

const Home = () => {
  const [blogs, setBlogs] = useState([
    {
      title: "Skin Burn",
      body: "lorem ipsum...",
      author: "Medi-Scanner",
      id: 1,
    },
    { title: "Bruises", body: "lorem ipsum...", author: "Medi-Scanner", id: 2 },
    {
      title: "Cuts",
      body: "lorem ipsum...",
      author: "Medi-Scanner",
      id: 3,
    },
  ]);

  return (
    <div className="home">
      <BlogList blogs={blogs} title="All Blogs" />
    </div>
  );
};

export default Home;
